async (username, password) => {
  return await storeValue("userdata", {
    "username": username,
    "password": password
  }).then(() => {
    return getLoginToken.run().then(res => res).catch(() => showAlert("Login ou senha incorretos"));
  }).then(res => {
    if (res.hasOwnProperty('access')) {
      return res;
    }
    return {};
  }).catch(() => showAlert("Login ou senha incorretos"));
}

